
// Dotrice, for the printer output.
// https://www.1001fonts.com/dotrice-font.html

import {CSS_PREFIX} from "./utils.js";

const FONT_CSS_ID_NAME = CSS_PREFIX + "-printer-css-font";
export const PRINTER_REGULAR_FONT_FAMILY = "Dotrice-regular";

// Kept in a different file so the long text isn't in our way.
// Make this with: base64 < file.otf > out.hex
const FONT_CSS = `
@font-face {
    font-family: "${PRINTER_REGULAR_FONT_FAMILY}";
    src: url("data:font/otf;base64,");
}
`;

/**
 * Add the above CSS to the page if it's not already there. Idempotent.
 */
export function addPrinterCssFontToPage(): void {
    if (document.getElementById(FONT_CSS_ID_NAME) === null) {
        const node = document.createElement("style");
        node.id = FONT_CSS_ID_NAME;
        node.innerHTML = FONT_CSS;
        document.head.append(node);
    }
}
